# If we are bringing in data tables like we would typically see in Excel, we are going to want to use pandas
#Pandas is another package that adds functionality to data structures, tables, and time series

#First we need to import pandas
import pandas as pd

#Now, we will use pandas to import a csv file of data
#df = data frame
df = pd.read_csv('/content/drive/MyDrive/UF/CZRCN/water.csv') #in quotes, you will add the file path to where your data is located

#Now that my data is loaded, I want to see what it looks like
#To do this, I want to see the 1st 5 rows, which is given by the .head() function
df.head()

#looks like I am missing units for bicarbonate, let's add a column for units
df['Bicarbonate units'] = 'mg/L CaCO3'

#How let's look at our dataFrame again
df.head()

#Let's say I want Bicarbonate in meq/L instead of mg/L, we have to do some conversions
#50 meq = 1 mg CaCO3
df['Bicarbonate (meq/L)'] = df['Bicarbonate']/50 
df.head()

#Since I know my data now, I can plot it up to see what it looks like

#both plots below show a different way of calling each column, but will show the same plot

plt.scatter(df.pH, df.Bicarbonate, label='Dot Plot Method')
plt.scatter(df['pH'], df['Bicarbonate'], s=10, label='Index Plot Method') #changed size to show markers in same position

plt.xlabel('pH')
plt.ylabel('Bicarbonate')
plt.legend()

# Let's add a trend line to our plot above

x=df.pH
y = df.Bicarbonate

#obtain m (slope) and b(intercept) of linear regression line
m, b = np.polyfit(x, y, 1)

#plot the original graph 
plt.scatter(df.pH, df.Bicarbonate, label='Original Water Data')

plt.xlabel('pH')
plt.ylabel('Bicarbonate')

#use red as color for regression line
plt.plot(x, m*x+b, color='red', label='Trend Line')
plt.legend()

"""###Subplots:"""

#What if I want to look at all my plots together?
#This is where we use subplots

fig, (ax1, ax2) = plt.subplots(1, 2, figsize=(10,5)) #this is saying I want 1 row with 2 columns of plots, you can mess with figsize to get the figure size you want
fig.suptitle('Horizontally stacked subplots') #title for both plots

ax1.scatter(df.pH, df.Bicarbonate, label='Dot Plot Method')
ax1.scatter(df['pH'], df['Bicarbonate'], s=10, label='Index Plot Method')
ax1.set_xlabel('pH') #this is different than plt! make sure you use *set*
ax1.set_ylabel('Bicarbonate in mg/L CaCO3')
ax1.legend()

ax2.scatter(df.pH, df.Bicarbonate, label='Original Water Data')
ax2.plot(x, m*x+b, color='red', label='Trend Line')
ax2.set_xlabel('pH') #this is different than plt! make sure you use *set*
ax2.legend()

#Let's say I want 4 subplots all together and to see how our plots got better over time: 
#Copy/paste code from before, but replace plt with ax1, ax2, ax3, or ax4 depending on where you want the plot 
#make sure you change labels to *set_label*

fig, ((ax1, ax2), (ax3, ax4)) = plt.subplots(2, 2, figsize=(10,10))

ax1.plot(my_array, my_array_squared) 

ax2.scatter(my_array, my_array_squared) 

ax3.plot(my_array, my_array_squared)
ax3.scatter(my_array, my_array_squared)
ax3.plot(my_FAST_array, my_FAST_array_5)

ax4.plot(my_array, my_array_squared, label='Squared', color='black', lw=3, ls='solid') 
ax4.scatter(my_array, my_array_squared, label='Squared Markers', color='black',s=30)
ax4.plot(my_FAST_array, my_FAST_array_5, label='5x+10', color='gray', lw=3, ls='dotted') 
ax4.set_xlabel('X LABEL') # add x label
ax4.set_ylabel('Y LABEL') # add y label
ax4.set_title('My Plot of Arrays')
ax4.legend()

